import React, { useState, useEffect } from 'react';
import { View, Text, Pressable, Image, TextInput, Modal } from "react-native";
import { Ionicons } from "@expo/vector-icons";

const FriendDirectory = ({ navigation }) => {

    return (
        <View className={"flex-1 justify-between bg-white"}>
            <View className={"flex flex-col"}>
                <View className={"flex flex-row"}>
                <Pressable><Ionicons name={"people-circle-outline"} size={24} color={"blue"} /></Pressable>
                </View>
            </View>
        </View>
    )
};
export default FriendDirectory;
